import stim
import numpy as np

def parse_stabilizers(stabilizers):
    num_qubits = len(stabilizers[0])
    num_stabilizers = len(stabilizers)
    
    xs = np.zeros((num_stabilizers, num_qubits), dtype=bool)
    zs = np.zeros((num_stabilizers, num_qubits), dtype=bool)
    
    for i, s in enumerate(stabilizers):
        if len(s) != num_qubits:
             print(f"Warning: Stabilizer {i} has length {len(s)}")
             print(f"Content: {s}")
        for j, char in enumerate(s):
            if char == 'X':
                xs[i, j] = True
            elif char == 'Z':
                zs[i, j] = True
            elif char == 'Y':
                xs[i, j] = True
                zs[i, j] = True
            elif char != 'I':
                raise ValueError(f"Unknown Pauli {char}")
                
    return xs, zs

